import React from 'react';
import { Box, TextField, Button, Typography } from '@mui/material';

function LoginSignupBox() {
  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: 2,
      }}
    >
      <Typography variant="h5" gutterBottom>
        Welcome Back!
      </Typography>
      <TextField
        label="Email"
        variant="outlined"
        fullWidth
        margin="normal"
        sx={{ backgroundColor: '#ffffff', borderRadius: 1 }}
      />
      <TextField
        label="Password"
        type="password"
        variant="outlined"
        fullWidth
        margin="normal"
        sx={{ backgroundColor: '#ffffff', borderRadius: 1 }}
      />
      <Button variant="contained" color="secondary" fullWidth sx={{ mt: 2 }}>
        Log In
      </Button>
      <Button variant="outlined" color="primary" fullWidth sx={{ mt: 2 }}>
        Create Account
      </Button>
    </Box>
  );
}

export default LoginSignupBox;
